import React from "react";
import UserCard from "./UserCard";

const ProductList = ({userList,removeUser}) => {
    return (
        <div>
            {
                userList.map((user,index) => { 
                    return (
                        <div>
                            <UserCard key={index} name={user.name} age={user.age} position={user.position} onClickRemove={()=> removeUser(index)}/>
                            <Button variant="contained" color="error" onClick={removeUser}>Delete</Button>
                        
                        </div>
                    )
                })
            }
            
        </div>
    )
}

export default ProductList;
